import {v4 as uuidV4} from 'uuid';
import './listcomponent.css'
const ListComponent=()=>{
   const [items,setItems]=useState([
       {
           name:'do homework',
           id:uuidV4()
        },
        {
            name:'purchase books',
            id:uuidV4()
         },
         {
            name:'do purchase books',
            id:uuidV4()
         },
         {
            name:'do excercise',
            id:uuidV4()
         }
   ])
   return (
       <div className="list__components">
           <div className="container">
                 <div className="add_new_todo">
                           <input id="todo_input"/>
                           <button id="add_todo_button">Add</button>
                </div>
           </div>
         
         
       </div>
   )
}
export default ListComponent;
